export const getDepartamentoByCodigo = (codigoDepartamento: any) => {
   return departamentos.filter(
      (d) => d.codigoDepartamento == codigoDepartamento,
   );
};

export const getCiudadPorDistrito = (codigoDistrito: any) => {
   return data.filter((record) => {
      return record.codigoDistrito == codigoDistrito;
   });
};

export const getDistritosPorDepartamento = (codigoDepartamento: any) => {
   const distritos = data.filter((record) => {
      return record.codigoDepartamento == codigoDepartamento;
   });

   const seen = new Set<number>();
   const sinDuplicados = distritos.filter((record) => {
      if (seen.has(record.codigoDistrito)) return false;
      seen.add(record.codigoDistrito);
      return true;
   });
   return sinDuplicados;
};
